    - prefect_sqlalchemy
    - Member[credentials].Member[DatabaseCredentials]
  - - pydantic.BaseModel~Subclass
    - prefect_sqlalchemy
    - Member[database].Member[ConnectionComponents]
  - - pydantic.BaseModel~Subclass
    - prefect_sqlalchemy
    - Member[database].Member[CredentialsBlock]
  - - pydantic.BaseModel~Subclass
    - prefect_sqlalchemy
    - Member[database].Member[DatabaseBlock]
  - - pydantic.BaseModel~Subclass
    - prefect_sqlalchemy
    - Member[database].Member[DatabaseCredentials]
